import React,{useEffect, useState} from 'react';

const Api = () => {
    const [users, setUsers] = useState([]);
    useEffect(() => {
        fetch('https://jsonplaceholder.typicode.com/users').then((response) => response.json()).then((data) => {setUsers(data)})
    }, []);

    return (
        <div>
            <h1>list users</h1>
            <ul>
            {
                users.map((data) => {
                    return <>
                        <li> {data.name} </li>
                    </>
                })
            }
            </ul>
        </div>
    );
}

export default Api;
